@dimacgarcia Você que se interessa por ciência de dados. Existe algum dataset sobre o qual há a possibilidade de correlação de votos entre os aliados e o Presidente?
Do tipo que contenha o número de votos a cada atualização.
A base Bolsonarista teve uma votação muito expressiva. Não custa ver

@eduardoafvieira @MWGAlina Eduardo me conhece. Sou de TI.
Apontar a fraude é simples: basta pegar todos os BUs onde deputados e senadores Bolsonaristas venceram, e contar os votos para o Presidentes nas mesmas urnas. 

Trabalho fácil de ciência de dados.

@alexandregarcia Tinha que somar os votos desses candidatos e ver qual a diferença. Pq a lógica diz que não tem lógica. 

@cienciadedados @CarambolaTech e todos outros... resolvam esse enigma  kkkkk 

